import React from 'react';
import Button from '@material-ui/core/Button';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import { makeStyles } from '@material-ui/core/styles';
export default function BasicButtonGroup() {

  return (
    <div className={classes.root}>
      <ButtonGroup color="primary" aria-label="outlined primary button group" fullwidth = "true">
        <Button>Current Projects</Button>
        <Button>SPOC</Button>
        <Button>Imp Links</Button>
        <Button>Social Team</Button>
      </ButtonGroup>
      <ButtonGroup variant="contained" color="primary" aria-label="contained primary button group" fullwidth = "true">
        <Button>Current Projects</Button>
        <Button>SPOC</Button>
        <Button>Imp Links</Button>
        <Button>Social Team</Button>
      </ButtonGroup>
      <ButtonGroup variant="text" color="primary" aria-label="text primary button group" fullwidth = "true">
        <Button>Current Projects</Button>
        <Button>SPOC</Button>
        <Button>Imp Links</Button>
        <Button>Social Team</Button>
      </ButtonGroup>
    </div>
  );
}
